  `id` int(11) NOT NULL auto_increment,
  `title` varchar(255) default NULL,
  `price` int(11) default NULL,
  `rating` int(11) default NULL,
  `content` mediumtext,
  `about` text,
  `location_id` int(11) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

