INSERT INTO `hotels` VALUES (1,'Hanoi Lake View Hotel',55,3,NULL,'We are honored to warmly Welcome you to Hanoi Lake View Hotel-Top ten Hotel of Hanoi Plaza hotel group. Our hotel management and associates are here to make your stay as comfortable, relaxing and memorable as possible...',NULL),(2,'M Hotel',135,4,NULL,'M Hotel (Formerly Hanoi Gouman hotel) is a truly boutique styled business hotel in the very heart of the commercial and diplomatic districts of Hanoi, assuring easy to access to UN Offices...',NULL),(3,'Hanoi Nikko Hotel',175,5,NULL,'The Hanoi  Nikko Hotel is located in the centre of the city offering fascinating views of the surrounding lakes and parklands. It is within easy access of prominent offices, historical attractions and popular shopping areas...',NULL),(4,'Hanoi Paradise Hotel',55,3,NULL,'Hanoi Paradise Hotel  is a newly opened in 2006 and one of the finest three-star hotels in Hanoi with Swimming-pool and Sauna. It has 27 luxury and standard rooms with exquisite European decoration...',NULL),(5,'Hanoi Sofitel Metropole Hotel',165,5,NULL,'Renowned as the most scenic hotel in Hanoi with its zigzag facade and \"stepped\" architecture, the 20-story Sofitel Plaza  is a familiar landmark of Hanoi',NULL),(6,'Hanoi Sunway Hotel',135,4,NULL,'Located in the heart of Hanoi city, the Sunway Hotel, is close to all the renowned tourist attractions, a mere 10 minute walk to Hoan Kiem lake and the prime commercial...',NULL),(7,'Heritage Hotel',60,3,NULL,'The Hanoi Heritage Hotel is ideally located along La Thanh Road within walking distance to the Giang Vo Exhibition Centre. It also offers easy access to the US Embassy...',NULL),(8,'Hoa Binh Hotel',65,3,NULL,'The Hoa Binh Hotel is a convenient base to discover all that Hanoi has to offer. All of the hotel\'s 103 rooms contain all the amenities that today\'s travelers desire...',NULL),(9,'Hong Ngoc 1 Hotel',61,2,NULL,'Hong Ngoc 1 Hotel located in the middle of Hanoi capital city',NULL),(10,'Army Hotel',55,3,NULL,'Built around 1960 and the latest renovation was in 2002, Army hotel is the only one three star hotel in downtown Hanoi having a swimming pool...',NULL),(11,'Asean International Hotel',55,3,NULL,'Hanoi is gradually gaining popularity and rising in status as a major tourist spot among the other tourist destinations in the region. Gradually more and more hotels are coming up to accommodate the large number of tourists every year...',NULL),(12,'Asia Hotel',28,3,NULL,'The Asia Hotel Hanoi is situated near to the city centre, just over 10 minutes walk from the tourist and business areas...',NULL),(13,'Bao Son Hotel',128,4,NULL,'The Bao Son Hotel, Hanoi is set in a prime location in an expanding area of the city. The Bao Son Hotel offers easy access to embassies, government offices, numerous tourist attractions and the nearby Giang Vo Exhibition Center...',NULL),(14,'Chains First Eden Hotel',35,3,NULL,'The Chains First Eden Hotel provides luxury and elegance which combines traditional Vietnamese culture with a high international standard of service, comfort and complete security....',NULL),(15,'Danly Hotel',75,3,NULL,'At the Danly, every guest will enjoy a well-equipped Standard, Superior, Deluxe and Suites with plenty of rooms to live, to work or just relax. Our warm inviting atmosphere, congenial staff and host of line services make every stay a most enjoyable one.',NULL),(16,'Win Hotel',30,2,'end hotel ha noi','At the top end of the budget accommodations, the Win is immaculate and homey all at once. On a quiet street just off Le Thai To Street, it\'s also just a short skip from Hoan Kiem Lake. Floor-to-ceiling one-way windows let Hanoi in, or you can keep the light out with lace and red-velvet curtains. ',NULL);
